import { Link } from 'react-router-dom';
import posts from './../../data/posts';

export default function Tag() {
	const tags = [...new Set(posts.map(post => post.tag.split(',')))]

	var duplicates = tags.reduce(function(acc, el, i, arr) {
			if (arr.indexOf(el) !== i && acc.indexOf(el) < 0) {
				acc.push(el);
			}

			return acc;
		}, []);

	let tagg = removeDuplicate(["PopojiCMS","CMS Indonesia", "PopojiCMS","CMS Indonesia","Manado"]);

	console.log(duplicate)

	return (
		<>
	    <h3 className="sidebar-title">Tags</h3>
	    <div className="sidebar-item tags">
	      <ul>
	      {
	      	tagg.map((tag, idx) => (<li><Link>{tag}</Link></li>))
	      }
	      </ul>
	    </div>
		</>
	)
}

